import React from 'react';
import { createGlobalStyle} from 'styled-components';

const GlobalSyle = createGlobalStyle `
     body {
          margin
     }
`

import Header from './elements/Header';
import Home from './Home'

const App = () => (
     <div>
     <Header />
     <Home />
</div>
)
export default App;
